import {FC} from "react";
import {CardContainer} from "./card";

type Props = {
    examples?: string[] | undefined;
    onItemSelection?: ((text: string) => void) | undefined;
}
const PromptExample: FC<Props> = (props) => {

    const itemsToShow = props.examples ?? [
        "What are dummies ?",
        "What is J.A.R.V.I.S ?",
        "What are some properties of an equipment in excel samples ?",
    ];
    const handleItemClick = (text: string) => {
        if (!props.onItemSelection) return;
        props.onItemSelection(text);
    }
    return (
        <div
            className={"grid gap-6 self-center justify-self-center absolute top-[20%] transform -translate-y-[-20%] max-w-[50%]"}>
            <div>
                <img
                    src="data:image/png;base64,"
                    alt="Lexio UI"
                    style={{
                        height: "30px",
                        minHeight: "30px",
                        minWidth: "100px",
                        objectFit: "contain",
                    }}
                />
                <div>
                    <p className={"text-3xl font-semibold leading-tight tracking-tighter md:text-5xl lg:leading-[1.1]"}>
                        Start here
                    </p>
                </div>
                <div className={"px-1"}>
                    <p className={"text-gray-500"}>
                        Ready to use UI components to build your RAG UI rapidly.
                    </p>
                </div>
            </div>
            <div className={"grid gap-3 grid-cols-[repeat(3,1fr)]"}>
                {itemsToShow.map((item, index) =>
                    <CardContainer
                        key={index}
                        className={"grid items-center content-center border-[1px] border-gray-300 p-8 cursor-pointer"}
                        onClick={() => handleItemClick(item)}
                    >
                        <div>
                            <p className={"text-md font-light text-foreground text-gray-800"}>
                                {item}
                            </p>
                        </div>
                    </CardContainer>
                )}
            </div>
        </div>
    );
}
PromptExample.displayName = "PromptExample";

export default PromptExample;
